/*Data for the table `announcement` */

insert  into `announcement`(`id`,`title`,`content`,`careate_time`,`delete_time`,`update_time`,`status`) values (1,'遇见博客','生活不止眼前的苟且还有诗和远方，所以去追求你要的诗和远方吧，在这里你可以畅所欲言，记录分享你美好的时光。欢迎来到遇见博客！来遇见另一个自己！一个人至少拥有一个梦想，有一个理由去坚强。心若没有栖息的地方，到哪里都是在流浪',0,0,0,0);

/*Table structure for table `article` */

DROP TABLE IF EXISTS `article`;

CREATE TABLE `article` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '文章表',
  `title` varchar(255) NOT NULL COMMENT '标题',
  `content` longtext NOT NULL COMMENT '文章内容',
  `label_id` varchar(50) NOT NULL COMMENT '外键，关联标签表',
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '外键，关联分类表',
  `is_top` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否置顶',
  `author_id` int(11) NOT NULL COMMENT '作者id',
  `author_name` varchar(255) NOT NULL COMMENT '作者\r\n名字',
  `read_num` int(11) NOT NULL DEFAULT '0' COMMENT '阅读统计',
  `img_id` int(11) NOT NULL DEFAULT '0' COMMENT '外键，关联图片',
  `careate_time` int(11) NOT NULL DEFAULT '0',
  `delete_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `status` tinyint(4) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;

/*Data for the table `article` */

insert  into `article`(`id`,`title`,`content`,`label_id`,`category_id`,`is_top`,`author_id`,`author_name`,`read_num`,`img_id`,`careate_time`,`delete_time`,`update_time`,`status`) values (1,'《生活不止眼前的苟且》','妈妈坐在门前，哼着花儿与少年虽已时隔多年，记得她泪水涟涟那些幽暗的时光，那些坚持与慌张在临别的门前，妈妈望着我说生活不止眼前的苟且，还有诗和远方的田野你赤手空拳来到人世间，为找到那片海不顾一切她坐在我对面，低头说珍重再见虽已时隔多年，记得她泪水涟涟那些欢笑的时光，那些誓言与梦想在分手的街边，她紧抱住我说生活不止眼前的苟且，还有诗和远方的田野你赤手空拳来到人世间，为找到那片海不顾一切我独自渐行渐远，膝下多了个少年少年一天天长大，有一天要离开家看他背影的成长，看他坚持与回望我知道有一天，我会笑着对他说生活不止眼前的苟且，还有诗和远方的田野你赤手空拳来到人世间，为找到那片海不顾一切。','1,2',0,1,1,'admin',50,0,0,0,0,1),(2,'愿你归来仍然是少年','亲爱的自己：我不知道为什么写信给你，更不知道你何时能收到这封信，在这里有些愿望寄托于你。首先愿你平安无事地度过青春期，但别平安无事地度过青春。你不是他们口中的乖乖女，这点我比谁都清楚，你有时的果断、激动甚至有点“草莽精神”的意思，着实让我吓了一跳。','3,4',0,0,1,'admin',66,0,0,0,0,1),(3,'流浪的人，不许掉眼泪','生命里，一些缱绻，无论素净，还是喧哗，都已经被岁月赋予了清喜的味道，一些闲词，或清新，或淡雅，总会在某一个回眸的时刻醉了流年，濡湿了柔软的心，冥冥之中，我们沿着呼唤的风声，终于在堆满落花的秋里，再次重逢，念在天涯，心在咫尺，我相信，一米阳光，才是我们最好的距离。缘起是诗，缘离是画，这些关于岁月，关于记忆的章节，终会被时光搁置在无法触及的红尘之外，曾经，你我一别经年，可风里，总有一段美丽会与我们不期而遇，一盏琉璃，半杯心悦，端然着那一份醉人的静，这安静行走的流年，总会被过往赋予一份清喜，一份浪漫。','5,6',0,0,1,'admin',666,5,0,0,0,1),(4,'分享《三毛语录》','如果有来生，要做一棵树，站成永恒，没有悲欢的姿势。一半在土里安详，一半在风里飞扬，一半洒落阴凉，一半沐浴阳光，非常沉默非常骄傲，从不依靠从不寻找。如果有来生，要做一棵树，站成永恒，没有悲欢的姿势。一半在土里安详，一半在风里飞扬，一半洒落阴凉，一半沐浴阳光，非常沉默非常骄傲，从不依靠从不寻找','3,5,6',0,0,1,'admin',666,0,0,0,0,1),(5,'人生之老生常谈','流年似水，岁月蹉跎，不知不觉的便遗忘了许多。曾经那些熟悉的容颜，似乎也都在岁月的风声里越去越远了，只余下一些记忆的痕迹，散落成一地的斑驳，再也找不回昨日的似锦繁华。看惯了花开花落，潮涨潮汐，也就不会再留恋什么。要走的，走了，来了，又走了；不想走的，也走了。行走在红尘，回首已是淡定；笑立在风中，看尽风景。伸出手，想握住眼前的一切，殊不知，手握得越紧，得到的却是满手空；放开手掌，眼前的一切却是那么真实。','1,7',0,0,1,'admin',666,6,0,0,0,1),(6,'君生我未生，我生君已老。','君生我未生，我生君已老。恨不生同时，日日与君好。 哲野也很喜欢夭夭，在叶兰离去的二十年间，夭夭早已代替了叶兰的位置。一个人早已老去，而另一个人还尚年轻。夭夭只能望着哲野死去。但我觉得夭夭不遗憾，她爱的这个人陪了她二十年时光，而哲野的爱永远埋藏在夭夭的心里.远了，只余下一些记忆的痕迹，散落成。','2,6',0,0,1,'admin',888,7,0,0,0,1);

